import Modal from '../../Modal';

class JoinIn extends React.Component {
    render() {
        return (
            <div>
                <Modal title="Hi there">
                    <h2>Are you ready to to join us ?</h2>
                </Modal>
            </div>
        );
    }
}

export default JoinIn;
